lyph":null,"nonselection_glyph":{"id":"8632"},"selection_glyph":null,"view":{"id":"8634"}},"id":"8633","type":"GlyphRenderer"},{"attributes":{},"id":"8851","type":"Selection"},{"attributes":{"text":"As predi\u00e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"8981","type":"Paragraph"},{"attributes":{"data":{"x":{"__ndarray__":"AACAaDkSd0IAAEDOixJ3QgAAADTeEndCAADAmTATd0IAAID/ghN3QgAAQGXVE3dCAAAAyycUd0IAAMAwehR3QgAAgJbMFHdCAABA/B4Vd0IAAABicRV3QgAAwMfDFXdCAACALRYWd0IAAECTaBZ3QgAAAPm6FndCAADAXg0Xd0IAAIDEXxd3QgAAQCqyF3dCAAAAkAQYd0IAAMD1Vhh3QgAAgFupGHdCAABAwfsYd0IAAAAnThl3QgAAwIygGXdCAACA8vIZd0IAAEBYRRp3QgAAAL6XGndCAADAI+oad0IAAICJPBt3QgAAQO+OG3dCAAAAVeEbd0IAAMC6Mxx3QgAAgCCGHHdCAABAhtgcd0IAAADsKh13QgAAwFF9HXdCAACAt88dd0IAAEAdIh53QgAAAIN0HndCAADA6MYed0IAAIBOGR93QgAAQLRrH3dCAAAAGr4fd0IAAMB/ECB3QgAAgOViIHdCAABAS7Ugd0IAAACxByF3QgAAwBZaIXdCAACAfKwhd0IAAEDi/iF3QgAAAEhRIndCAADAraMid0IAAIAT9iJ3QgAAQHlII3dCAAAA35ojd0IAAMBE7SN3QgAAgKo/JHdCAABAEJIkd0IAAAB25CR3
